    )

    return (
        <>
            <div className='appContainer'>
                <Routes>
                    {/* <svg id="Layer_1" data-name="Layer 1" xmlns="http://www.w3.org/2000/svg" viewBox="0 0 270.41 956.26"><defs><style>.cls-1{fill:#1c75bc;}</style></defs><path class="cls-1" d="M244.33-97.52s444,322.52,0,947.85H479s96-715.17-26.67-956.25Z" transform="translate(-244.33 105.92)"/></svg> */}
